INSERT INTO `qt` VALUES (1,'2019','10','10','오직 여호와께로 가까이','여호수아 23:1-16','\n\n1 여호와께서 주위의 모든 원수들로부터 이스라엘을 쉬게 하신 지 오랜 후에 여호수아가 나이 많아 늙은지라\n<br/>2 여호수아가 온 이스라엘 곧 그들의 장로들과 수령들과 재판장들과 관리들을 불러다가 그들에게 이르되 나는 나이가 많아 늙었도다\n<br/>3 너희의 하나님 여호와께서 너희를 위하여 이 모든 나라에 행하신 일을 너희가 다 보았거니와 너희의 하나님 여호와 그는 너희를 위하여 싸우신 이시니라\n<br/>4 보라 내가 요단에서부터 해 지는 쪽 대해까지의 남아 있는 나라들과 이미 멸한 모든 나라를 내가 너희를 위하여 제비 뽑아 너희의 지파에게 기업이 되게 하였느니라\n<br/>5 너희의 하나님 여호와 그가 너희 앞에서 그들을 쫓아내사 너희 목전에서 그들을 떠나게 하시리니 너희의 하나님 여호와께서 너희에게 말씀하신 대로 너희가 그 땅을 차지할 것이라\n<br/>6 그러므로 너희는 크게 힘써 모세의 율법 책에 기록된 것을 다 지켜 행하라 그것을 떠나 우로나 좌로나 치우치지 말라\n<br/>7 너희 중에 남아 있는 이 민족들 중에 들어 가지 말라 그들의 신들의 이름을 부르지 말라 그것들을 가리켜 맹세하지 말라 또 그것을 섬겨서 그것들에게 절하지 말라\n<br/>8 오직 너희의 하나님 여호와께 가까이 하기를 오늘까지 행한 것 같이 하라\n<br/>9 이는 여호와께서 강대한 나라들을 너희의 앞에서 쫓아내셨으므로 오늘까지 너희에게 맞선 자가 하나도 없었느니라\n<br/>10 너희 중 한 사람이 천 명을 쫓으리니 이는 너희의 하나님 여호와 그가 너희에게 말씀하신 것 같이 너희를 위하여 싸우심이라\n<br/>11 그러므로 스스로 조심하여 너희의 하나님 여호와를 사랑하라\n<br/>12 너희가 만일 돌아서서 너희 중에 남아 있는 이 민족들을 가까이 하여 더불어 혼인하며 서로 왕래하면\n<br/>13 확실히 알라 너희의 하나님 여호와께서 이 민족들을 너희 목전에서 다시는 쫓아내지 아니하시리니 그들이 너희에게 올무가 되며 덫이 되며 너희의 옆구리에 채찍이 되며 너희의 눈에 가시가 되어서 너희가 마침내 너희의 하나님 여호와께서 너희에게 주신 이 아름다운 땅에서 멸하리라\n<br/>14 ○보라 나는 오늘 온 세상이 가는 길로 가려니와 너희의 하나님 여호와께서 너희에게 대하여 말씀하신 모든 선한 말씀이 하나도 틀리지 아니하고 다 너희에게 응하여 그 중에 하나도 어김이 없음을 너희 모든 사람은 마음과 뜻으로 아는 바라\n<br/>15 너희의 하나님 여호와께서 너희에게 말씀하신 모든 선한 말씀이 너희에게 임한 것 같이 여호와께서 모든 불길한 말씀도 너희에게 임하게 하사 너희의 하나님 여호와께서 너희에게 주신 이 아름다운 땅에서 너희를 멸절하기까지 하실 것이라\n<br/>16 만일 너희가 너희의 하나님 여호와께서 너희에게 명령하신 언약을 범하고 가서 다른 신들을 섬겨 그들에게 절하면 여호와의 진노가 너희에게 미치리니 너희에게 주신 아름다운 땅에서 너희가 속히 멸망하리라 하니라\n\n'),(2,'2019','10','11','세겜 언약','여호수아 24:1-18','\n\n1 여호수아가 이스라엘 모든 지파를 세겜에 모으고 이스라엘 장로들과 그들의 수령들과 재판장들과 관리들을 부르매 그들이 하나님 앞에 나와 선지라\n<br/>2 여호수아가 모든 백성에게 이르되 이스라엘의 하나님 여호와께서 이같이 말씀하시기를 옛적에 너희의 조상들 곧 아브라함의 아버지, 나홀의 아버지 데라가 강 저쪽에 거주하여 다른 신들을 섬겼으나\n<br/>3 내가 너희의 조상 아브라함을 강 저쪽에서 이끌어 내어 가나안 온 땅에 두루 행하게 하고 그의 씨를 번성하게 하려고 그에게 이삭을 주었으며\n<br/>4 이삭에게는 야곱과 에서를 주었고 에서에게는 세일 산을 소유로 주었으나 야곱과 그의 자손들은 애굽으로 내려갔으므로\n<br/>5 내가 모세와 아론을 보내었고 또 애굽에 재앙을 내렸나니 곧 내가 그들 가운데 행한 것과 같고 그 후에 너희를 인도하여 내었노라\n<br/>6 내가 너희의 조상들을 애굽에서 인도하여 내어 바다에 이르게 한즉 애굽 사람들이 병거와 마병을 거느리고 너희의 조상들을 홍해까지 쫓아오므로\n<br/>7 너희의 조상들이 나 여호와께 부르짖기로 내가 너희와 애굽 사람들 사이에 흑암을 두고 바다를 이끌어 그들을 덮었나니 내가 애굽에서 행한 일을 너희의 눈이 보았으며 또 너희가 많은 날을 광야에서 거주하였느니라\n<br/>8 내가 또 너희를 인도하여 요단 저쪽에 거주하는 아모리 족속의 땅으로 들어가게 하매 그들이 너희와 싸우기로 내가 그들을 너희 손에 넘겨 주매 너희가 그 땅을 점령하였고 나는 그들을 너희 앞에서 멸절시켰으며\n<br/>9 또한 모압 왕 십볼의 아들 발락이 일어나 이스라엘과 싸우더니 사람을 보내어 브올의 아들 발람을 불러다가 너희를 저주하게 하려 하였으나\n<br/>10 내가 발람을 위해 듣기를 원하지 아니하였으므로 그가 오히려 너희를 축복하였고 나는 너희를 그의 손에서 건져내었으며\n<br/>11 너희가 요단을 건너 여리고에 이른즉 여리고 주민들 곧 아모리 족속과 브리스 족속과 가나안 족속과 헷 족속과 기르가스 족속과 히위 족속과 여부스 족속이 너희와 싸우기로 내가 그들을 너희의 손에 넘겨 주었으며\n<br/>12 내가 왕벌을 너희 앞에 보내어 그 아모리 족속의 두 왕을 너희 앞에서 쫓아내게 하였나니 너희의 칼이나 너희의 활로써 이같이 한 것이 아니며\n<br/>13 내가 또 너희가 수고하지 아니한 땅과 너희가 건설하지 아니한 성읍들을 너희에게 주었더니 너희가 그 가운데에 거주하며 너희는 또 너희가 심지 아니한 포도원과 감람원의 열매를 먹는다 하셨느니라\n<br/>14 ○그러므로 이제는 여호와를 경외하며 온전함과 진실함으로 그를 섬기라 너희의 조상들이 강 저쪽과 애굽에서 섬기던 신들을 치워 버리고 여호와만 섬기라\n<br/>15 만일 여호와를 섬기는 것이 너희에게 좋지 않게 보이거든 너희 조상들이 강 저쪽에서 섬기던 신들이든지 또는 너희가 거주하는 땅에 있는 아모리 족속의 신들이든지 너희가 섬길 자를 오늘 택하라 오직 나와 내 집은 여호와를 섬기겠노라 하니\n<br/>16 백성이 대답하여 이르되 우리가 결단코 여호와를 버리고 다른 신들을 섬기기를 하지 아니하오리니\n<br/>17 이는 우리 하나님 여호와께서 친히 우리와 우리 조상들을 인도하여 애굽 땅 종 되었던 집에서 올라오게 하시고 우리 목전에서 그 큰 이적들을 행하시고 우리가 행한 모든 길과 우리가 지나온 모든 백성들 중에서 우리를 보호하셨음이며\n<br/>18 여호와께서 또 모든 백성들과 이 땅에 거주하던 아모리 족속을 우리 앞에서 쫓아내셨음이라 그러므로 우리도 여호와를 섬기리니 그는 우리 하나님이심이니이다 하니라\n\n'),(3,'2019','10','12','언약의 증표','여호수아 24:19-33','\n\n19	○여호수아가 백성에게 이르되 너희가 여호와를 능히 섬기지 못할 것은 그는 거룩하신 하나님이시요 질투하시는 하나님이시니 너희의 잘못과 죄들을 사하지 아니하실 것임이라\n<br/>20	만일 너희가 여호와를 버리고 이방 신들을 섬기면 너희에게 복을 내리신 후에라도 돌이켜 너희에게 재앙을 내리시고 너희를 멸하시리라 하니\n<br/>21	백성이 여호수아에게 말하되 아니니이다 우리가 여호와를 섬기겠나이다 하는지라\n<br/>22	여호수아가 백성에게 이르되 너희가 여호와를 택하고 그를 섬기리라 하였으니 스스로 증인이 되었느니라 하니 그들이 이르되 우리가 증인이 되었나이다 하더라\n<br/>23	여호수아가 이르되 그러면 이제 너희 중에 있는 이방 신들을 치워 버리고 너희의 마음을 이스라엘의 하나님 여호와께로 향하라 하니\n<br/>24	백성이 여호수아에게 말하되 우리 하나님 여호와를 우리가 섬기고 그의 목소리를 우리가 청종하리이다 하는지라\n<br/>25	그 날에 여호수아가 세겜에서 백성과 더불어 언약을 맺고 그들을 위하여 율례와 법도를 제정하였더라\n<br/>26	여호수아가 이 모든 말씀을 하나님의 율법책에 기록하고 큰 돌을 가져다가 거기 여호와의 성소 곁에 있는 상수리나무 아래에 세우고\n<br/>27	모든 백성에게 이르되 보라 이 돌이 우리에게 증거가 되리니 이는 여호와께서 우리에게 하신 모든 말씀을 이 돌이 들었음이니라 그런즉 너희가 너희의 하나님을 부인하지 못하도록 이 돌이 증거가 되리라 하고\n<br/>28	백성을 보내어 각기 기업으로 돌아가게 하였더라\n<br/>29	○이 일 후에 여호와의 종 눈의 아들 여호수아가 백십 세에 죽으매\n<br/>30	그들이 그를 그의 기업의 경내 딤낫 세라에 장사하였으니 딤낫 세라는 에브라임 산지 가아스 산 북쪽이었더라\n<br/>31	이스라엘이 여호수아가 사는 날 동안과 여호수아 뒤에 생존한 장로들 곧 여호와께서 이스라엘을 위하여 행하신 모든 일을 아는 자들이 사는 날 동안 여호와를 섬겼더라\n<br/>32	○또 이스라엘 자손이 애굽에서 가져 온 요셉의 뼈를 세겜에 장사하였으니 이곳은 야곱이 백 1크시타를 주고 세겜의 아버지 하몰의 자손들에게서 산 밭이라 그것이 요셉 자손의 기업이 되었더라\n<br/>33	아론의 아들 엘르아살도 죽으매 그들이 그를 그의 아들 비느하스가 에브라임 산지에서 받은 산에 장사하였더라\n'),(4,'2019','10','13','복음의 동역자','빌립보서 1:1-11','\n\n1	그리스도 예수의 종 바울과 디모데는 그리스도 예수 안에서 빌립보에 사는 모든 성도와 또한 감독들과 집사들에게 편지하노니\n<br/>2	하나님 우리 아버지와 주 예수 그리스도로부터 은혜와 평강이 너희에게 있을지어다\n<br/>3	○내가 너희를 생각할 때마다 나의 하나님께 감사하며\n<br/>4	간구할 때마다 너희 무리를 위하여 기쁨으로 항상 간구함은\n<br/>5	너희가 첫날부터 이제까지 복음을 위한 일에 참여하고 있기 때문이라\n<br/>6	너희 안에서 착한 일을 시작하신 이가 그리스도 예수의 날까지 이루실 줄을 우리는 확신하노라\n<br/>7	내가 너희 무리를 위하여 이와 같이 생각하는 것이 마땅하니 이는 너희가 내 마음에 있음이며 나의 매임과 복음을 변명함과 확정함에 너희가 다 나와 함께 은혜에 참여한 자가 됨이라\n<br/>8	내가 예수 그리스도의 심장으로 너희 무리를 얼마나 사모하는지 하나님이 내 증인이시니라\n<br/>9	내가 기도하노라 너희 사랑을 지식과 모든 총명으로 점점 더 풍성하게 하사\n<br/>10	너희로 1지극히 선한 것을 분별하며 또 진실하여 허물 없이 그리스도의 날까지 이르고\n<br/>11	예수 그리스도로 말미암아 의의 열매가 가득하여 하나님의 영광과 찬송이 되기를 원하노라\n\n\n'),(5,'2019','10','14','오직 복음을 위해','빌립보서 1:12-26','\n\n12 ○형제들아 내가 당한 일이 도리어 복음 전파에 진전이 된 줄을 너희가 알기를 원하노라\n<br/>13 이러므로 나의 매임이 그리스도 안에서 모든 시위대 안과 그 밖의 모든 사람에게 나타났으니\n<br/>14 형제 중 다수가 나의 매임으로 말미암아 주 안에서 신뢰함으로 겁 없이 하나님의 말씀을 더욱 담대히 전하게 되었느니라\n<br/>15 어떤 이들은 투기와 분쟁으로, 어떤 이들은 착한 뜻으로 그리스도를 전파하나니\n<br/>16 이들은 내가 복음을 변증하기 위하여 세우심을 받은 줄 알고 사랑으로 하나\n<br/>17 그들은 나의 매임에 괴로움을 더하게 할 줄로 생각하여 순수하지 못하게 다툼으로 그리스도를 전파하느니라\n<br/>18 그러면 무엇이냐 겉치레로 하나 참으로 하나 무슨 방도로 하든지 전파되는 것은 그리스도니 이로써 나는 기뻐하고 또한 기뻐하리라\n<br/>19 이것이 너희의 간구와 예수 그리스도의 성령의 도우심으로 나를 구원에 이르게 할 줄 아는 고로\n<br/>20 나의 간절한 기대와 소망을 따라 아무 일에든지 부끄러워하지 아니하고 지금도 전과 같이 온전히 담대하여 살든지 죽든지 내 몸에서 그리스도가 존귀하게 되게 하려 하나니\n<br/>21 이는 내게 사는 것이 그리스도니 죽는 것도 유익함이라\n<br/>22 그러나 만일 육신으로 사는 이것이 내 일의 열매일진대 무엇을 택해야 할는지 나는 알지 못하노라\n<br/>23 내가 그 둘 사이에 끼었으니 차라리 세상을 떠나서 그리스도와 함께 있는 것이 훨씬 더 좋은 일이라 그렇게 하고 싶으나\n<br/>24 내가 육신으로 있는 것이 너희를 위하여 더 유익하리라\n<br/>25 내가 살 것과 너희 믿음의 진보와 기쁨을 위하여 너희 무리와 함께 거할 이것을 확실히 아노니\n<br/>26 내가 다시 너희와 같이 있음으로 그리스도 예수 안에서 너희 자랑이 나로 말미암아 풍성하게 하려 함이라\n\n'),(6,'2019','10','15','복음에 합당하게','빌립보서 1:27-2:4','\n\n27 오직 너희는 그리스도의 복음에 합당하게 생활하라 이는 내가 너희에게 가 보나 떠나 있으나 너희가 한마음으로 서서 한 뜻으로 복음의 신앙을 위하여 협력하는 것과\n<br/>28 무슨 일에든지 대적하는 자들 때문에 두려워하지 아니하는 이 일을 듣고자 함이라 이것이 그들에게는 멸망의 증거요 너희에게는 구원의 증거니 이는 하나님께로부터 난 것이라\n<br/>29 그리스도를 위하여 너희에게 은혜를 주신 것은 다만 그를 믿을 뿐 아니라 또한 그를 위하여 고난도 받게 하려 하심이라\n<br/>30 너희에게도 그와 같은 싸움이 있으니 너희가 내 안에서 본 바요 이제도 내 안에서 듣는 바니라\n<br/>1 그러므로 그리스도 안에 무슨 권면이나 사랑의 무슨 위로나 성령의 무슨 교제나 긍휼이나 자비가 있거든\n<br/>2 마음을 같이하여 같은 사랑을 가지고 뜻을 합하며 한마음을 품어\n<br/>3 아무 일에든지 다툼이나 허영으로 하지 말고 오직 겸손한 마음으로 각각 자기보다 남을 낫게 여기고\n<br/>4 각각 자기 일을 돌볼뿐더러 또한 각각 다른 사람들의 일을 돌보아 나의 기쁨을 충만하게 하라\n\n'),(7,'2019','10','16','순종으로 이루는 구원','빌립보서 2:5-18','\n\n5 너희 안에 이 마음을 품으라 곧 그리스도 예수의 마음이니\n<br/>6 그는 근본 하나님의 본체시나 하나님과 동등됨을 취할 것으로 여기지 아니하시고\n<br/>7 오히려 자기를 비워 종의 형체를 가지사 사람들과 같이 되셨고 또는 본체\n<br/>8 사람의 모양으로 나타나사 자기를 낮추시고 죽기까지 복종하셨으니 곧 십자가에 죽으심이라\n<br/>9 이러므로 하나님이 그를 지극히 높여 모든 이름 위에 뛰어난 이름을 주사\n<br/>10 하늘에 있는 자들과 땅에 있는 자들과 땅 아래에 있는 자들로 모든 무릎을 예수의 이름에 꿇게 하시고\n<br/>11 모든 입으로 예수 그리스도를 주라 시인하여 하나님 아버지께 영광을 돌리게 하셨느니라\n<br/>12 ○그러므로 나의 사랑하는 자들아 너희가 나 있을 때뿐 아니라 더욱 지금 나 없을 때에도 항상 복종하여 두렵고 떨림으로 너희 구원을 이루라\n<br/>13 너희 안에서 행하시는 이는 하나님이시니 자기의 기쁘신 뜻을 위하여 너희에게 소원을 두고 행하게 하시나니\n<br/>14 모든 일을 원망과 시비가 없이 하라\n<br/>15 이는 너희가 흠이 없고 순전하여 어그러지고 거스르는 세대 가운데서 하나님의 흠 없는 자녀로 세상에서 그들 가운데 빛들로 나타내며\n<br/>16 생명의 말씀을 밝혀 나의 달음질이 헛되지 아니하고 수고도 헛되지 아니함으로 그리스도의 날에 내가 자랑할 것이 있게 하려 함이라\n<br/>17 만일 너희 믿음의 제물과 섬김 위에 내가 나를 전제로 드릴지라도 나는 기뻐하고 너희 무리와 함께 기뻐하리니\n<br/>18 이와 같이 너희도 기뻐하고 나와 함께 기뻐하라 또는 하느니라\n\n'),(8,'2019','10','17','그리스도의 일을 위하여','빌립보서 2:19-30','\n\n19 ○내가 디모데를 속히 너희에게 보내기를 주 안에서 바람은 너희의 사정을 앎으로 안위를 받으려 함이니\n<br/>20 이는 뜻을 같이하여 너희 사정을 진실히 생각할 자가 이밖에 내게 없음이라\n<br/>21 그들이 다 자기 일을 구하고 그리스도 예수의 일을 구하지 아니하되\n<br/>22 디모데의 연단을 너희가 아나니 자식이 아버지에게 함같이 나와 함께 복음을 위하여 수고하였느니라\n<br/>23 그러므로 내가 내 일이 어떻게 될지를 보아서 곧 이 사람을 보내기를 바라고\n<br/>24 나도 속히 가게 될 것을 주 안에서 확신하노라\n<br/>25 그러나 에바브로디도를 너희에게 보내는 것이 필요한 줄로 생각하노니 그는 나의 형제요 함께 수고하고 함께 군사 된 자요 너희 사자로 내가 쓸 것을 돕는 자라\n<br/>26 그가 너희 무리를 간절히 사모하고 자기가 병든 것을 너희가 들은 줄을 알고 심히 근심한지라\n<br/>27 그가 병들어 죽게 되었으나 하나님이 그를 긍휼히 여기셨고 그뿐 아니라 또 나를 긍휼히 여기사 내 근심 위에 근심을 면하게 하셨느니라\n<br/>28 그러므로 내가 더욱 급히 그를 보낸 것은 너희로 그를 다시 보고 기뻐하게 하며 내 근심도 덜려 함이니라\n<br/>29 이러므로 너희가 주 안에서 모든 기쁨으로 그를 영접하고 또 이와 같은 자들을 존귀히 여기라\n<br/>30 그가 그리스도의 일을 위하여 죽기에 이르러도 자기 목숨을 돌보지 아니한 것은 나를 섬기는 너희의 일에 부족함을 채우려 함이니라\n\n');
