INSERT INTO `team` VALUES (1,'1','기쁨','기쁨의 나라','호세아 6:3 그러므로 우리가 여호와를 알자 힘써 여호와를 알자 그의 나타나심은 새벽 빛 같이 	어김없나니 비와 같이, 땅을 적시는 늦은 비와 같이 우리에게 임하시리라 하니라',1,'N'),(2,'1','언약','언약의 숲','골로새서 1:12 우리로 하여금 빛 가운데서 성도의 기업의 부분을 얻기에 합당하게 하신 아버지께 감사하게 하시기를 원하노라',1,'N'),(3,'1','등대','목자의 등대','에베소서 5:8,9 너희가 전에는 어둠이더니 이제는 주 안에서 빛이라 빛의 자녀들처럼 행하라 빛의 열매는 모든 착함과 의로움과 진실함에 있느니라',1,'N'),(4,'1','1새가족','1청년부 새가족팀','고린도전서 2:2 내가 너희 중에서 예수 그리스도와 그가 십자가에 못 박히신 것 외에는 아무 것도 알지 아니하기로 작정하였음이라',1,'N'),(5,'2','정감','정이 넘치고 감사가 넘치는 마을','요한일서 4:11,12 사랑하는 자들아 하나님이 이같이 우리를 사랑하셨은즉 우리도 서로 사랑하는 것이 마땅하도다 어느 때나 하나님을 본 사람이 없으되 만일 우리가 서로 사랑하면 하나님이 우리 안에 거하시고 그의 사랑이 우리안에 온전히 이루어 지느니라',1,'N'),(6,'2','은행','하나되어 은혜롭고 행복한 공동체','에베소서 1:17-19 우리주 예수 그리스도의 하나님, 영광의 아버지께서 지혜와 계시의 영을 너희에게 주사 하나님을 알게 하시고 너희 마음의 눈을 밝히사 그의 부르심의 소망이 무엇이며 성도안에서 그 기업의 영광의 풍성함이 무엇이며 그의 힘의 위력으로 역사하심을 따라 믿는 우리에게 베푸신 능력의 지극히 크심이 어떠한 것을 너희로 알게하시기를 구하노라',1,'N'),(7,'2','열공','열린 공동체','누가복음 13:27 누구든지 자기 십자가를 지고 나를 따르지 않는 자도 능히 내 제자가 되지 못하리라',1,'N'),(8,'2','2새가족','2청년부 새가족팀','누가복음 15:32 이 네 동생은 죽었다가 살아났으며 내가 잃었다가 얻었기로 우리가 즐거워하고 기뻐하는 것이 마땅하다 하니라',1,'N'),(9,'1','동산','소망품은 동산','민수기 6:24-26 여호와는 네게 복을 주시고 너를 지키시기를 원하며 여호와는 그의 얼굴을 네게 비추사 은혜 베푸시기를 원하며 여호와는 그 얼굴을 네게로 향하여 드사 평강 주시기를 원하노라 할지니라하라',1,'N'),(10,'3','기타',NULL,NULL,1,'N');
/*!40000 ALTER TABLE `team` ENABLE KEYS */;
